import React from "react"

type Movie = {
    imdbID: string;
    Year: string;
    Poster: string;
    Title: string;
    Type: string;
}

export const MoviePage: React.FC<{ movie: Movie }> = ({ movie }) => {
    const { imdbID, Year, Poster, Title, Type } = movie;

    return(
        <div className="movie" key={imdbID}>
            Movie
        </div>
    )
}
